import React from 'react';
import ReactDOM from 'react-dom';
//import * as serviceWorker from './serviceWorker';

import './bootstrap.min.css'
import { Alert, Row, Col, Container, Popover, Button, PopoverHeader, PopoverBody, Collapse, CardBody, Card, Form, FormGroup, FormFeedback, Label, Input, InputGroup, InputGroupAddon } from 'reactstrap';
import Graph from "./Graph";
import './BuckConverter.css';

class BuckConverter extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      rate: 0,
      rateTemp: 0,
      time: 0,
      strom: 0,
      stromTemp: 0,
      voltage: 0,
      voltageTemp: 0,
      power: 0,
      renderElement: "svgSwitch",
      loggedInAdmin: this.props.loggedInAdmin,

      ///////Lifted state from "Circuit_Dobo.js"
      acceptingElement: "circuit",
      popoverOpen: false,
      //schalterOpen: false,
      ////////////////////////////////////////
      /////A variable for the switching intervall////
      switchIt: null,

      ///////////////////////////////////////
      /////A varibale for the collapsing text. Text is open per "default"
      collapse: false,

    };
    this.toggle = this.toggle.bind(this);
    this.handleRateChange = this.handleRateChange.bind(this);
    this.handleCurrentChange = this.handleCurrentChange.bind(this);
    this.handleVoltageChange = this.handleVoltageChange.bind(this);
    this.handleParams = this.handleParams.bind(this);
    this.handleRenderButton = this.handleRenderButton.bind(this);
    this.resetBuckConverter = this.resetBuckConverter.bind(this);
    this.toggleCollapse = this.toggleCollapse.bind(this);
    this.handleElectronAnimation = this.handleElectronAnimation.bind(this);
    this.handleSvgAnimation = this.handleSvgAnimation.bind(this);

  }





  editState(prop, value) {

    let dummyState = this.state;
    dummyState[prop] = value;
    console.log("Should be edited: ");
    console.log(dummyState);
    return dummyState;
  }

  toggle() {
    this.setState(this.editState("popoverOpen", !this.state.popoverOpen));
  }

  toggleCollapse() {
    this.setState(this.editState("collapse", !this.state.collapse));
  }

  showPopoverAt(elem) {
    console.log("In showPopover");
    this.setState(this.editState("acceptingElement", elem));
    this.toggle();
    this.handleRenderButton(elem);
  }


  flipping() {
    var pathOpen = "m 587.1907,128.48809 19.46984,-8.53849";
    var pathClosed = "m 587.1907,128.48809 19.85288,0.0973";

    var svgSwitchLine = document.getElementById('svgSwitchLine');
    if (svgSwitchLine.getAttribute("d") === pathOpen) {
      svgSwitchLine.setAttribute("d", pathClosed);
    } else {
      svgSwitchLine.setAttribute("d", pathOpen);
    }
  }

  flipSwitch() {
    console.log("switch")

    if (this.state.switchIt == null) {
      this.editState("switchIt", setInterval(this.flipping, 500));
    }

    //Schlater offen: <path d="m 587.1907,131.48809 15.46984,0" id="line2-1" class="colors" style="fill:none;stroke-width:3.54330897;stroke-linecap:square;stroke-linejoin:miter;stroke-miterlimit:4;stroke-opacity:1;stroke-dasharray:none"/>
    //object.attr('d') == pathOpen;
  }

  resetBuckConverter() {
    var pathOpen = "m 587.1907,128.48809 19.46984,-8.53849";

    //Die Linie des Schalters im SVG
    var svgSwitchLine = document.getElementById('svgSwitchLine');

    //Tastgrad
    var dutyCycleInput = document.getElementById('D_');

    //Eingangsstrom
    var currentInput = document.getElementById('I_e');

    //Eingangsspannung
    var voltageInput = document.getElementById('U_e');

    clearInterval(this.state.switchIt);
    svgSwitchLine.setAttribute("d", pathOpen);

    dutyCycleInput.setAttribute('value', 0);
    dutyCycleInput.removeAttribute('disabled');
    currentInput.setAttribute('value', 0)
    currentInput.removeAttribute('disabled');
    voltageInput.setAttribute('value', 0)
    voltageInput.removeAttribute('disabled');

    document.getElementById('info_workstate').innerHTML = "TSS ist aus.";
    document.getElementById('info_workstate').classList.remove("alert-success");
    document.getElementById('info_workstate').classList.add("alert-danger");

    const array_el_path = document.querySelectorAll('.electron_path') || null;

    for (var i = 0; i < array_el_path.length; i++) {
      array_el_path.item(i).classList.add('electron_path_hidden');
      array_el_path.item(i).classList.remove('electron_path');
      array_el_path.item(i).classList.remove('animation_reverse');

    }


    this.setState({
      rate: 0,
      rateTemp: 0,
      time: 0,
      strom: 0,
      stromTemp: 0,
      voltage: 0,
      voltageTemp: 0,
      power: 0,
      renderElement: "svgSwitch",
      visible: false,
      switchIt: null,
    });
  }



  //////////////




  handleRenderButton(a) {
    this.setState({
      renderElement: a
    })
  }

  handleParams() {
    if (this.state.stromTemp <= 10 && this.state.stromTemp > 0 && this.state.voltageTemp <= 100 && this.state.voltageTemp > 0 && this.state.rateTemp <= 1 && this.state.rateTemp > 0) {

      this.setState({
        strom: this.state.stromTemp,
        voltage: this.state.voltageTemp,
        rate: this.state.rateTemp,
      });

      document.getElementById("D_").setAttribute("disabled", "");
      document.getElementById("I_e").setAttribute("disabled", "");
      document.getElementById("U_e").setAttribute("disabled", "");

      this.flipSwitch();
      document.getElementById('info_workstate').innerHTML = "TSS ist an!";
      document.getElementById('info_workstate').classList.remove("alert-danger");
      document.getElementById('info_workstate').classList.add("alert-success");

      this.handleElectronAnimation();
    }


    else {
      alert("D muss zwischen 0 und 1 liegen, \n Ie zwischen 0 und 10 \n Ue zwischen 0 und 100");
    }

  }

  handleRateChange(event) {

    console.log(event);


    if (event.target.value >= 0 && event.target.value <= 1) {
      this.setState({
        rateTemp: event.target.value
      });
    } else {
      //alert("Der Wert des ... soll im Interval (0;1] sein.")
      let dutyCycleInput = document.getElementById("D_");
      let formFeedback = document.getElementById("feedback-D_");
      dutyCycleInput.classList.add("is-invalid");
      formFeedback.classList.add("invalid-feedback");

    }
  }

  handleCurrentChange(event) {
    if (event.target.value > 0 && event.target.value <= 100) {
      this.setState({
        stromTemp: event.target.value
      });
    } else {


      alert("Der Wert des Tastgrads soll im Interval (0;1] sein.")

    }
  }

  handleVoltageChange(event) {
    if (event.target.value > 0 && event.target.value <= 100) {
      this.setState({
        voltageTemp: event.target.value
      });
    } else {
      alert("Der Wert des Tastgrads soll im Interval (0;1] sein.")

    }
  }

  handleElectronAnimation() {

    let elPathRegex = new RegExp("el_path_[6-9]");

    var array_el_path = document.querySelectorAll('.electron_path_hidden');
    for (var i = 0; i < array_el_path.length; i++) {
      array_el_path.item(i).classList.add('electron_path');
      if (elPathRegex.test(array_el_path.item(i).id)) {
        array_el_path.item(i).classList.add('animation_reverse');
      }
      array_el_path.item(i).classList.remove('electron_path_hidden');

    }
  }

  handleSvgAnimation () {

    for (var i = 1; i < 20; i++){
      if (i === 2 ){
        continue;
      }
    let svgPath = document.querySelector(`#path-${i}`);
    let pathLength = svgPath.getTotalLength();
    svgPath.setAttribute("stroke-dasharray", pathLength);
    svgPath.setAttribute("stroke-dashoffset", pathLength);
    svgPath.classList.add("drawing-animation");
    }

    let svgSwitchLine = document.getElementById('svgSwitchLine');
    let pathLength = svgSwitchLine.getTotalLength();
    svgSwitchLine.setAttribute('stroke-dasharray', pathLength);
    svgSwitchLine.setAttribute('stroke-dashoffset', pathLength);
    svgSwitchLine.classList.add('drawing-animation');

    for ( i = 1; i < 8; i++){

    let svgArrow = document.querySelector(`#arrow-${i}`);
    let pathLength = svgArrow.getTotalLength();
    svgArrow.setAttribute("stroke-dasharray", pathLength);
    svgArrow.setAttribute("stroke-dashoffset", pathLength);
    svgArrow.classList.add("drawing-animation");
    }

    for ( i = 1; i < 3; i++){

      let svgPoint = document.querySelector(`#point-${i}`);
      let pathLength = svgPoint.getTotalLength();
      svgPoint.setAttribute("stroke-dasharray", pathLength);
      svgPoint.setAttribute("stroke-dashoffset", pathLength);
      svgPoint.classList.add("drawing-animation");
      }

    for ( i = 1; i < 3; i++){

      let svgPoint = document.querySelector(`#switchPoint-${i}`);
      let pathLength = svgPoint.getTotalLength();
      svgPoint.setAttribute("stroke-dasharray", pathLength);
      svgPoint.setAttribute("stroke-dashoffset", pathLength);
      svgPoint.classList.add("drawing-animation");
  }
}


  componentDidMount() {
    this.timer = setInterval(
      () => this.increment(),
      200
    )
    console.log("REACT started!");
    //var el_path = document.querySelector('#line_before_coil');

    /** 
     * Getting the length of the first line in the electron cyclic path
     * and applying it to simulate a movement of electrons.
     */
    var el_path = document.querySelector('#path-4');
    var el_path_length = el_path.getTotalLength();
    this.editState("el_path_length", el_path_length);
    this.handleSvgAnimation();

  }
  componentWillUnmount() {
    clearInterval(this.timer)
  }
  increment() {
    this.setState(prevState => ({

      time: prevState.time + 0.2
      //(Math.round((this.state.time + 5)*10)/10))/1,

    }))
    //this.state.time += (Math.round((this.state.time + 1)*10)/10);
  }



  //var el_path = document.querySelector('#line_before_coil');
  // var el_path = document.querySelector('#path3129-4-8');
  //var el_path_length = el_path.getTotalLength();



  render() {

    const eingang = (

      <div className="forms animated">
        <Form>
          <FormGroup>
            <Label for="D_">Tastgrad</Label>
            <InputGroup>
              <InputGroupAddon addonType="prepend">D =</InputGroupAddon>
              <Input type="number" min="0" max="1" step="0.05" id="D_" name="D_" value={this.state.rateTemp} onChange={this.handleRateChange} />
            </InputGroup>
            <FormFeedback id="feedback-D_">The value should be part of the interval (0;1]</FormFeedback>
          </FormGroup>
          <FormGroup>
            <Label for="I_e">Eingangsstrom</Label>
            <InputGroup>
              <InputGroupAddon addonType="prepend">Ie =</InputGroupAddon>
              <Input type="number" min="0" max="10" step="0.1" id="I_e" name="I_e" value={this.state.stromTemp} onChange={this.handleCurrentChange} />
            </InputGroup>
          </FormGroup>
          <FormGroup>
            <Label for="U_e">Eingangsspannung</Label>
            <InputGroup>
              <InputGroupAddon addonType="prepend">Ue =</InputGroupAddon>
              <Input type="number" min="0" max="100" step="1" id="U_e" name="U_e" value={this.state.voltageTemp} onChange={this.handleVoltageChange} />
            </InputGroup>
          </FormGroup>
          <FormGroup>
            <Label for="P_e">Eingangsleistung</Label>
            <p><strong>Pe = {(this.state.stromTemp * this.state.voltageTemp).toFixed(2)} </strong></p>
          </FormGroup>
        </Form>

        <Button outline color="success" onClick={this.handleParams}>Start</Button>
        <span> </span>
        <Button outline color="danger" onClick={this.resetBuckConverter}>Stop</Button>
      </div>
    );

    const diode = (
      <div>
        <Graph
          time={this.state.time}
          strom={this.state.strom}
          voltage={this.state.voltage}
          rate={this.state.rate}
          power={this.state.power}
          part="Ud in V"


        ></Graph>,
        <Graph
          time={this.state.time}
          strom={this.state.strom}
          voltage={this.state.voltage}
          rate={this.state.rate}
          power={this.state.power}
          part="Id in A"


        ></Graph>
      </div>
    );
    const svgSwitch = (
      <div>
        <Graph
          time={this.state.time}
          strom={this.state.strom}
          voltage={this.state.voltage}
          rate={this.state.rate}
          power={this.state.power}
          part="Us in V"


        ></Graph>,
        <Graph
          time={this.state.time}
          strom={this.state.strom}
          voltage={this.state.voltage}
          rate={this.state.rate}
          power={this.state.power}
          part="Is in A"


        ></Graph>
      </div>
    );
    const spule = (

      <div>
        <Graph
          time={this.state.time}
          strom={this.state.strom}
          voltage={this.state.voltage}
          rate={this.state.rate}
          power={this.state.power}
          part="Ul in V"


        ></Graph>,
        <Graph
          time={this.state.time}
          strom={this.state.strom}
          voltage={this.state.voltage}
          rate={this.state.rate}
          power={this.state.power}
          part="Il in A"


        ></Graph>
      </div>
    );
    const ausgang = (
      <div className="forms animated">
        <Label for="I_e">Ausgangsspannung</Label>
        <p><strong>Ua = {(this.state.voltage * this.state.rate).toFixed(2)}</strong></p>

        <Label for="P_e">Ausgangsleistung</Label>
        <p><strong>Pa = </strong>{Math.round(this.state.voltage * (this.state.strom / 10), 2)}</p>
      </div>
    );

    let x = this.state.renderElement
    let content_;
    //console.log("here we are" + x);
    switch (x) {
      case "diode": {

        content_ = diode
        break;
      }
      case "switchPoint-1": {

        content_ = svgSwitch;
        break;
      }
      case "spule_windungen": {
        content_ = spule;
        break;
      }
      case "spannungsquelle_a": {
        content_ = ausgang;
        break;
      }
      default: {
        content_ = eingang;
      }
    }


    return (

      <Container className="grid">
        <Row>
          <Col md="3">
            {eingang}
          </Col>
          <Col md="6">

            <div className="the_wrapper">
              <Popover placement={"bottom"} isOpen={this.state.popoverOpen} target={this.state.acceptingElement} toggle={this.toggle}>
                <PopoverHeader>Graph</PopoverHeader>
